import { io, Socket } from "socket.io-client";
import { User } from "../types/user";
import { userAction } from "../context/actions/userAction";
import { AppDispatch } from "../context/store";
import { onlineUpdate } from "../context/reducer/userReducer";

export const socketClient: Socket = io("http://localhost:5000", {
  withCredentials: true,
  autoConnect: false,
  extraHeaders: {
    "my-custom-header": "abcd",
  },
});

export const testing = (dispatch: AppDispatch) => {
  socketClient.on("online friend", (data: any) => {
    console.log(data);
  });
};
